webpackJsonp([43667588424557],{5102:function(e,t){e.exports={data:{post:{html:'<p><b>Euro 2000 semifinal: Italy 3 Holland 1 in penalties (0-0 after extra time)</b> So much for offensive soccer. Italy got a red card early, but Holland missed two penalties in regular time and lost their nerve long before the shootout even started. (<a href="http://sportsillustrated.cnn.com/soccer/world/2000/euro2000/news/2000/06/29/ned_ita_ap/">CNNSI.com story</a>)</p>\n<p>Italy will meet France in the final on Sunday. Then things are quiet until the World Cup in 2002. <i>Qualifications begin for Germany in September.</i></p>\n<p><b>Hamburg news</b> A 6 year old boy was killed by a pit bull on an inner-city school playground during recess on Monday. The story is still in the headlines today. </p>\n<p>After a slow start, the <b>Expo</b> in Hannover is up to 150,000 visitors per day. However, need over 300,000 per day to meet their projection of 40 million total.</p>',fields:{title:"Mit dem Zweiten sieht man besser",date:"29 Jun 2000",url:"https://papascott.de/2000-06-29-mit-dem-zweiten-sieht-man-besser/"}}},pathContext:{slug:"/2000-06-29-mit-dem-zweiten-sieht-man-besser/",prev:{fields:{title:"Wednesday",date:"28 Jun 2000",slug:"/2000-06-28-wednesday/"}},next:{fields:{title:"The Difference between Europe and America",date:"01 Jul 2000",slug:"/2000-07-01-the-difference-between-europe-and-america/"}}}}}});
